import logo from './logo.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          hi boss, welcome to the familia.
        </p>
      </header>
    </div>
  );
}

export default App;
